// deep.js
import React from 'react';
import './Deep.css';

const Deep = () => {
  return (
    <div className="vertical-navbar">
      
      <button className="cylindrical-button">Button 1</button>
      <button className="cylindrical-button">Button 2</button>
      <button className="cylindrical-button">Button 3</button>
      <button className="cylindrical-button">Button 4</button>
    </div>
  
  );
}

export default Deep;
